CREATE TABLE `pilstaxa` (
    `tid` INT(10) UNSIGNED NOT NULL,

    `isTerrestrial` TINYINT(1) NOT NULL DEFAULT 0,
    `isBrackish` TINYINT(1) NOT NULL DEFAULT 0,
    `isFreshwater` TINYINT(1) NOT NULL DEFAULT 0,
    `isMarine` TINYINT(1) NOT NULL DEFAULT 0,

    PRIMARY KEY (`tid`),

    CONSTRAINT `fk_pilstaxa_tid`
        FOREIGN KEY (`tid`)
        REFERENCES `taxa` (`tid`)
        ON DELETE CASCADE
        ON UPDATE CASCADE
) ENGINE=InnoDB
DEFAULT CHARSET=utf8
COLLATE=utf8_general_ci;

